    <div className="container mt-3 ">

      <UpdateLiveStats/>

      <div className="row">
        <div className="col-sm-6 col-lg-3 d-flex justify-content-center">
          <LiveStats />
        </div>
        <div className="col-sm-6 col-lg-3 d-flex justify-content-center">
          <LiveStats />
        </div>
        <div className="col-sm-6 col-lg-3 d-flex justify-content-center">
          <LiveStats />
        </div>
        <div className="col-sm-6 col-lg-3 d-flex justify-content-center">
          <LiveStats />
        </div>
      </div>

    <StateSlider />

    </div>
  );
};

export default Home;
